import React from 'react';
import './App.css';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import SignIn from './components/SignIn'

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route path='/signin' component={SignIn}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
